import React from "react";
import Input from "../components/Input";

function Login() {
    return (
        <form className="form">
            <Input type="text" placeholder="Username" />
            <Input type="password" placeholder="Password" />
            <button type="submit">Se connecter</button>
        </form>
    );
}

export default Login;
